import React from "react";
import "./header.css";

const Header = () => {
  return (
    <header className="header">
      <nav className="nav container">
        <a href="index.html" className="nav_logo">Smith</a>
        <div className="nav_menu">
          ul.nav_list
        </div>
      </nav>
    </header>
  );
};

export default Header;
